import React from 'react';


export default function ExtendedTableRow(props){  
    return (   
        <div style={style.container}>
           <div style={style.childContent}>
                <h1 style={style.extendedTitle}>Acesso do Usuário</h1>
           </div>
           <div style={style.childContent}>
                <h1 style={style.extendedTitle}>Endereço do usuário</h1>
           </div>

           <div style={style.childContent}>
                <h1 style={style.extendedTitle}>Produto Comprado</h1>
           </div>

           <div style={style.childContent}>
                <h1 style={style.extendedTitle}>Produto Comprado</h1>
           </div>

           <div style={style.childContent}>
                <h1 style={style.extendedTitle}>Produto Comprado</h1>
           </div>

           <div style={style.childContent}>
                <h1 style={style.extendedTitle}>Produto Comprado</h1>
           </div>

           <div style={style.childContent}>
                <h1 style={style.extendedTitle}>Produto Comprado</h1>
           </div>

        </div>
 

    )
}


const style = {
    container: {
        backgroundColor: "#a1a1a1",
        width: "100%",
        height: "500px"
    },

    childContent: {
        width: "100%",
        height:"12.5%",
        backgroundColor: "black"
        
    },

    extendedTitle:{
        fontSize : "18px",
        color: "white"
    }

};
